import React from "react";
import { products } from "../constant";
import AdComponent from "./AdComponent";
import ProductCard from "./ProductCard";

const Product = () => {
  const adClient = "ca-pub-xxxxxxxxxxxxxxxx"; // Replace with your AdSense client ID
  const adSlot = "xxxxxxxxxx"; // Replace with your AdSense slot ID

  return (
    <div>
      <AdComponent adClient={adClient} adSlot={adSlot} />
      <div class="font-[sans-serif] bg-gray-100">
        <div class="p-4 mx-auto lg:max-w-7xl sm:max-w-full"></div>
      </div>
      <div className="container mx-auto">
        <h1 className="text-3xl font-bold my-6">Products</h1>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6">
          {products.map((product) => (
            <ProductCard key={product.id} product={product} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default Product;
